import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { apiRequest } from '../utils/api';
import { getToken } from '../utils/auth';

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [clubs, setClubs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const token = getToken();
        const userData = await apiRequest('/api/v1/users/me', {
          token
        });
        setUser(userData);
        
        // Mock club data
        setClubs([
          { id: 1, name: 'Tennis Club Sofia', role: 'Member', nextSession: '2024-07-01' },
          { id: 2, name: 'Basketball Sharks', role: 'Admin', nextSession: '2024-06-28' },
        ]);
        
        setLoading(false);
      } catch (err) {
        setError('Failed to load user data');
        setLoading(false);
      }
    };
    
    fetchUserData();
  }, []);

  if (loading) return (
    <div className="min-h-screen bg-black flex items-center justify-center">
      <div className="text-center">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500 mx-auto"></div>
        <p className="mt-4 text-gray-400">Loading dashboard...</p>
      </div>
    </div>
  );

  if (error) return (
    <div className="min-h-screen bg-black p-6">
      <div className="max-w-4xl mx-auto bg-red-900/30 border border-red-800 text-red-300 p-4 rounded">
        <p>{error}</p>
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-black text-white p-6">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-3xl font-bold mb-8">Dashboard</h1>
        
        {/* User Info */}
        <div className="bg-gray-800 rounded-lg p-6 mb-8 shadow-lg">
          <h2 className="text-xl font-semibold mb-4">Your Profile</h2>
          <div className="flex flex-col md:flex-row items-center md:items-start gap-6">
            <div className="w-24 h-24 bg-gray-700 rounded-full flex items-center justify-center text-3xl font-bold">
              {user?.username?.charAt(0).toUpperCase() || 'U'}
            </div>
            <div>
              <p className="text-lg font-medium">{user?.username || 'User'}</p>
              <p className="text-gray-400">{user?.email || 'user@example.com'}</p>
              <button className="mt-4 bg-blue-600 hover:bg-blue-700 px-4 py-2 rounded text-sm">
                Edit Profile
              </button>
            </div>
          </div>
        </div>
        
        {/* Your Clubs */}
        <div className="bg-gray-800 rounded-lg p-6 mb-8 shadow-lg">
          <div className="flex justify-between items-center mb-4">
            <h2 className="text-xl font-semibold">Your Clubs</h2>
            <a href="/create-club" className="bg-blue-600 hover:bg-blue-700 px-4 py-2 rounded text-sm">
              Create Club
            </a>
          </div>
          
          {clubs.length === 0 ? (
            <p className="text-gray-400">You haven't joined any clubs yet.</p>
          ) : (
            <div className="overflow-x-auto">
              <table className="w-full text-left">
                <thead className="bg-gray-700 text-gray-300">
                  <tr>
                    <th className="p-3 rounded-tl-lg">Club Name</th>
                    <th className="p-3">Your Role</th>
                    <th className="p-3">Next Session</th>
                    <th className="p-3 rounded-tr-lg">Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {clubs.map((club) => (
                    <tr key={club.id} className="border-b border-gray-700">
                      <td className="p-3 font-medium">{club.name}</td>
                      <td className="p-3">{club.role}</td>
                      <td className="p-3">{club.nextSession}</td>
                      <td className="p-3">
                        <a href={`/clubs/${club.id}`} className="text-blue-400 hover:underline">
                          View
                        </a>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          )}
        </div>
        
        {/* Upcoming Reservations */}
        <div className="bg-gray-800 rounded-lg p-6 shadow-lg">
          <h2 className="text-xl font-semibold mb-4">Upcoming Reservations</h2>
          <p className="text-gray-400">You don't have any upcoming reservations.</p>
          <button className="mt-4 bg-orange-600 hover:bg-orange-700 px-4 py-2 rounded text-sm">
            Book a Court
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
